import React,{ useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [todolist, settodo] = useState({})

  useEffect( () => {
    console.log('On Going Connection')
    fetch('localhost:8000/todos')
      .then(res => {
        console.log('-------------------------------------->')
        console.log(res)
        settodo(res.data)
      })
      .catch(err => {
        console.log('============================================>')
        console.log(err)
      })

  },[])
  return (
    <div className="App">
      {console.log(todolist)}
        {
          todolist.map( data => 
            <p key={data.id}>{data.title}</p>
          )
        }
    </div>
  );
}

export default App;
